import { styled } from '@mui/material/styles';
import me from '../src/me.svg'
import Box from '@material-ui/core/Box';

function Hero() {
  return (
    <Container style={{ background: '#F2E7D6', position: 'absolute'}}  maxWidth="xl">
        <Grid> 
        <h1>Hi</h1>
        <Grid item>
          <Box bgcolor="primary.light" p={2}>
            This is the First Grid
          </Box>
        </Grid>
        <Grid item>
          <Box bgcolor="secondary.light" p={2}>
            This is the Second Grid
          </Box>
        </Grid>
        </Grid>


    </Container>
  )
}

export default Hero;
